import "./App.css";
import HomePage from "./Homepage/Homepage";
import { Component } from "react";
import Navbar from "./Components/Navbar/Navbar";

class App extends Component {
  render() {
    return (
      <div className="App">
        <HomePage></HomePage>
        <Navbar></Navbar>
      </div>
    );
  }
}

export default App;
